import {
  Box,
  Button,
  Card,
  CardActions,
  CardContent,
  CardHeader,
  Typography,
} from "@mui/material";

interface PollCardProps {
  cardTitle: string;
  cardDescription: string;
}

const PollCard = (props: PollCardProps): JSX.Element => {
  return (
    <Card
      variant="outlined"
      sx={{
        width: "400px",
        maxHeight: "600px",
        display: "flex",
        justifyContent: "space-between",
        flexDirection: "column",
      }}
    >
      <CardContent>
        <Typography variant="h4">{props.cardTitle}</Typography>
        <Typography variant="subtitle1">{props.cardDescription}</Typography>
      </CardContent>
      <CardActions>
        <Button>Vote</Button>
      </CardActions>
    </Card>
  );
};

export default PollCard;
